import {config} from "../constants/api";
import { getComptes} from "../redux/actions/compte-actions";
import axiosInstance from "../request.interceptor";
import {Compte} from "../entities/compte";
import {getCreances, getCreancier,getCreanciers} from "../redux/actions/creanciers-actions";

export const fetchAllCreanciers = () => (dispatch: any) =>
    axiosInstance.get(`${config.API_URL}/creanciers/all`)
        .then(({data}) => {
            dispatch(getCreanciers(data));
        }).catch((e:any)=> console.log("Error", e));

export const fetchCreancier = () => (dispatch: any,idCreancier:string) =>
    axiosInstance.get(`${config.API_URL}/creanciers/`+idCreancier)
        .then(({data}) => {
            dispatch(getCreancier(data));
        });

export const fetchCreances = () => (dispatch: any,idCreancier:string,idCreance:string) =>
    axiosInstance.get(`${config.API_URL}/creanciers/`+idCreancier+`/`+idCreance)
        .then(({data}) => {
            dispatch(getCreances(data));
        });
